import TagLink from '../../components/TagLink';

import HomeIcon from './'

function Home() {
    return (<>
        <Header>
            <Title>My Blog App</Title>
        </Header>
        <Nav>
            <TagLink />
        </Nav>
    </>)
}

export default Home;
